  "privacy_content": "<h2>Personvernserklæring</h2> <p>Denne personvernerklæringen gjelder for bruk av PharmaLedger Association Electronic Product Information-produktet. </p> <h2>Kontakter</h2><ul class=\"list-space\" role=\"list\"><li role=\"listitem\"><b>a)  Identitet og kontaktinformasjon for behandlingsansvarlig eller felles behandlingsansvarlige</b><p>Behandlingsansvarlig for dine opplysninger er PharmaLedger Association.</p></li><li role=\"listitem\"><b>b) Kontakter for personvernombudet</b><p>Personvernombudet i PharmaLedger Association kan kontaktes på dpo@pharmaledger.org.</p></li></ul><h2>Hvilke personopplysninger vi bruker</h2><p>Vi samler bare inn de tekniske dataene som kreves for å levere ditt elektroniske pakningsvedlegg. Dette inkluderer IP-adressen din og tekniske identifikatorer for enheten og nettleseren du bruker for å få tilgang til applikasjonen vår.</p> <p><em>I detalj samler vi inn følgende dataelementer:</em></p><ul><li><p><em>Mobilenhetstilgang.</em> Vi kan be om tilgang eller tillatelse til visse funksjoner på mobilenheten din, inkludert kameraet på mobilenheten og andre funksjoner. Hvis du ønsker å endre vår tilgang eller våre tillatelser, kan du gjøre det i enhetens innstillinger.</p></li><li><p><em>Mobilenhetsdata.</em> Vi samler automatisk inn enhetsinformasjon (f.eks. mobilenhetens ID, modell og produsent), operativsystem, versjonsinformasjon og systemkonfigurasjonsinformasjon, enhets- og applikasjonsidentifikasjonsnummer, nettlesertype og -versjon, maskinvaremodell, internettleverandør og/eller mobiloperatør og IPadresse (eller proxy-server). Hvis du bruker applikasjonen(e) vår(e), kan vi også samle inn informasjon om telefonnettverket som er knyttet til mobilenheten din, mobilenhetens operativsystem eller plattform, typen mobilenhet du bruker, mobilenhetens unike enhets-ID og informasjon om hvilke funksjoner i applikasjonen(e) vår(e) du har brukt. </p></li></ul><h2>Hvorfor vi samler inn personopplysningene dine </h2><h3>Formål</h3><p>Vi samler inn de tekniske opplysningene dine for å kunne gi deg et elektronisk pakningsvedlegg for medisinen din. </p><p>Derfor kan vi basere oss på følgende rettslige grunnlag for å behandle personopplysningene dine:</p><ul><li><p><b>Oppfyllelse av en kontrakt.</b> Vi kan behandle personopplysningene dine når vi mener det er nødvendig for å oppfylle kontraktsforpliktelser overfor deg, inkludert å levere tjenestene våre eller på forespørsel fra deg før vi inngår en kontrakt med deg.</p></li><li><p><b>Juridiske Forpliktelser.</b> Vi kan behandle personopplysningene dine når vi mener det er nødvendig for å overholde våre juridiske forpliktelser, for eksempel for å oppfylle våre forpliktelser i henhold til helseforskrifter og folkehelselovgivning.</p></li></ul><h2>Hvem vi deler personopplysningene dine med</h2><p>Medlemsselskaper og tredjeparts tjenesteleverandører.</p><p>Vi deler opplysningene dine med tredjepartsleverandører, tjenesteleverandører, entreprenører eller agenter (\"tredjeparter\") som utfører tjenester for oss eller på våre vegne, og som trenger tilgang til slike opplysninger for å utføre arbeidet. Vi har kontrakter med våre tredjeparter som er utformet for å beskytte personopplysningene dine. Det betyr at de ikke kan gjøre noe med personopplysningene dine med mindre vi har instruert dem om å gjøre det. De vil heller ikke dele personopplysningene dine med andre organisasjoner enn oss. De forplikter seg også til å beskytte opplysningene de oppbevarer på våre vegne, og til å oppbevare dem i den perioden vi instruerer dem om. Kategoriene av tredjeparter vi kan dele personopplysninger med, er som følger:</p><ul><li><p>Legemiddelprodusenter (medlemsbedrifter)</p></li><li><p>Leverandører av tekniske tjenester</p></li></ul><h2>Hvor lenge vi lagrer personopplysningene dine</h2><p>PharmaLedger Association lagrer kun dine tekniske data så lenge det er nødvendig for å behandle din forespørsel om pakningsvedlegg, i opptil 30 dager. </p><p>Legemiddelprodusenten din vil også lagre opplysningene dine i en definert periode i henhold til deres retningslinjer for datalagring. Ta kontakt med legemiddelprodusenten din for mer informasjon om dette.</p><h2>Hvis du ikke oppgir personopplysningene dine til oss </h2><p>Hvis du velger å ikke oppgi dine tekniske data til oss, kan vi ikke oppfylle din forespørsel om pakningsvedlegg.</p><h2>Dine rettigheter</h2><p>Hvis du har forespørsler knyttet til personopplysningene dine i henhold til GDPR, for eksempel en forespørsel om å få tilgang til eller slette opplysningene dine, kan du kontakte oss på dpo@pharmaledger.org.</p><p>Vi vil behandle slike forespørsler innen 30 dager.</p><h2>Tilbaketrekking av samtykke</h2><p>Hvis du har forespørsler knyttet til personopplysningene dine i henhold til GDPR, for eksempel en forespørsel om å få tilgang til eller slette opplysningene dine, kan du kontakte oss på dpo@pharmaledger.org.</p><p>Vi vil behandle slike forespørsler innen 30 dager.</p><h2>Automatisert beslutningstaking</h2><p>Vi bruker ikke automatiserte beslutningsprosesser når vi leverer denne tjenesten til deg.</p><h2>Internasjonal overføring av personopplysninger</h2><p>Hvis legemiddelprodusenten din krever at vi overfører opplysningene dine utenfor EU, bruker vi standard kontraktsklausuler for å beskytte opplysningene dine.</p><h2>Hvordan du kan klage</h2><p>Hvis du har forespørsler knyttet til personopplysningene dine i henhold til GDPR, for eksempel en forespørsel om å få tilgang til eller slette opplysningene dine, kan du kontakte oss på dpo@pharmaledger.org.</p><p>Vi vil behandle slike forespørsler innen 30 dager. Du kan også kontakte din lokale tilsynsmyndighet hvis du mener at rettighetene dine ikke blir oppfylt.</p>",
