  "terms_content": "<h2>Vilkår og betingelser for PharmaLedger Associations nettsted og applikasjon for elektronisk produktinformasjon</h2><p>Ved å gå inn på eller bruke PharmaLedger Associations nettsted og applikasjon for elektronisk produktinformasjon (\"Tjenestene \"), godtar du å være bundet av disse betingelser og vilkår (\" Vilkårene\"). Du kan ikke få tilgang til eller bruke tjenestene hvis du ikke godtar disse vilkårene. Tjenestene drives av PharmaLedger Association (\"Foreningen\") og er beregnet på bruk av enkeltpersoner som søker informasjon om sine legemidler. Et flerpartsnettverk leverer Tjenestene, og legemiddelprodusenten din leverer produktinformasjonen som vises gjennom Tjenestene. Foreningen er behandlingsansvarlig for denne informasjonen. </p><h2>Bruk av tjenestene</h2><p>Du samtykker i å bruke Tjenestene kun til lovlige formål, og på en måte som ikke krenker rettighetene til, eller begrenser eller hindrer tredjeparts bruk og glede av Tjenestene. En slik begrensning eller hindring inkluderer, uten begrensning, atferd som er ulovlig, eller som kan trakassere eller forårsake nød eller ulempe for noen person, og overføring av uanstendig eller støtende innhold eller forstyrrelse av den normale dialogflyten i tjenestene. </p><h2>Immaterielle rettigheter</h2><p> Innholdet i Tjenestene, inkludert, men ikke begrenset til, tekst, grafikk, bilder og programvare, tilhører Forbundet eller dets lisensgivere og medlemsbedrifter og er beskyttet av opphavsrett og andre lover om immaterielle rettigheter. Du kan ikke bruke noe innhold fra Tjenestene til kommersielle formål uten uttrykkelig skriftlig samtykke fra Foreningen. </p><h2>Ansvar</h2><p>Foreningen gir ingen garantier av noe slag, verken uttrykkelig eller underforstått, med hensyn til driften av Tjenestene eller informasjonen, innholdet, materialet eller produktene som inngår i Tjenestene. Foreningen er ikke ansvarlig for skader av noe slag som oppstår som følge av bruk av Tjenestene, inkludert, men ikke begrenset til, direkte, indirekte, tilfeldige, straffende og følgeskader. </p><h2>Gjeldende lov</h2><p>Disse vilkårene og din bruk av tjenestene skal reguleres av og tolkes i samsvar med lovgivningen i Sveits, og eventuelle tvister skal løses ved domstolene i Basel, Sveits. </p><h2>Endringer i vilkårene</h2><p> Foreningen forbeholder seg retten til å endre disse Vilkårene når som helst, og du er ansvarlig for å sjekke disse Vilkårene med jevne mellomrom for eventuelle endringer. Hvis du fortsetter å bruke Tjenestene etter at det er gjort endringer i Vilkårene, innebærer det at du aksepterer de reviderte Vilkårene.</p><p><br></p>",
