  "about_content": "<h2>Om denne appen</h2><p>Denne appen leveres til deg av PharmaLedger®. Den er utviklet i samarbeid mellom pasientorganisasjoner, legemiddelselskaper og teknologieksperter.</p><p>Brukerne av appen kan se informasjon om legemidlet sitt ved å skanne strekkoden på produktpakningen.</p><p>Informasjonen som vises, kommer fra innehaveren av markedsføringstillatelsen for produktet.</p><h2>Om PharmaLedger</h2><p>PharmaLedger® er varemerket til PharmaLedger Association (PLA).</p><p>PLA er en global, ideell og nøytral forening. Foreningens formål er å skape og fremme et økosystem for digital tillit i helsevesenet.</p><p>Foreningen fremmer samarbeid i helse- og livsvitenskapssektoren og fremmer innovasjoner og implementering av disse til gjensidig nytte for pasienter og andre interessenter.</p>",
