  "help_modal_subtitle": "Ofte stilte spørsmål (FAQs)",
  "help_content": "<div><p><b><h2>Hva er EPI?</h2></b></p><p><b>EPI</b> er en forkortelse for <b>elektronisk produktinformasjon</b>. Det er en elektronisk versjon av papir-pakningsvedlegget du vanligvis finner i pakningen til et legemiddel. I noen tilfeller kan <b>EPI</b> ha erstattet pakningsvedlegget på papir.</p><p><b><h2>Hva er PharmaLedger?</h2></b></p><p>PharmaLedger Association (PLA) er en ideell organisasjon med base i Sveits som har som formål å muliggjøre og fremme et digitalt økosystem for tillit i helsevesenet gjennom en standardisert og pålitelig plattform med åpen kildekode. PLA fremmer samarbeid og akselererer innovasjon og bruk for å oppnå gjensidige fordeler for pasienter og andre interessenter innen helsevesenet og livsvitenskap. PLA ble dannet i 2022 for å videreføre arbeidet i PharmaLedger-prosjektet, et treårig prosjekt finansiert av EU-kommisjonen og legemiddelindustrien med sikte på å bevise verdien av blokkjedeløsninger. Du finner mer informasjon på https://pharmaledger.org.</p><p><b><h2>Hva er DataMatrix?</h2></b></p><p>Det er en slags strekkode på produktpakningen. Det er en strekkode i form av en svart og hvit firkantet boks som ser ut som dette:<br><img src=\"./images/barcode_example.png\" alt='DataMatrix barcode example'></p><p><b><h2>Hvordan bruker jeg appen?</h2></b></p><p>Følg instruksjonene på landingssiden til <b>appen</b>… den viser et bilde av hvor du finner <b>DataMatrix</b> på produktpakken. Når du har funnet <b>DataMatrix</b>, klikker du på knappen \"Scan <b>DataMatrix</b>\". La programmet bruke kameraet slik at <b>DataMatrix</b> kan skannes. Bruk kameraet til å fokusere på <b>DataMatrix</b>. Når pakken er skannet, vises <b>EPI</b>-en. Du kan klikke på '+'-knappen for å få flere detaljer.</p><p><b><h2>Hvorfor gir DataMatrix-skanningen ikke noe resultat?</h2></b></p><p>Det kan være flere grunner til at <b>DataMatrix</b>-skanningen på pakningen din ikke gir et EPI-resultat. En av årsakene kan være kameraets fokus. Prøv å skanne koden på et godt opplyst sted, slik at koden er godt synlig på skjermen. Hvis du har problemer med å holde hånden stødig, kan du prøve å bruke et bord som støtte for hendene.</p></div>",
